import { Fragment } from "react";
import Closets from "../../Components/Closets";
import styles from "./styles.module.scss";

const clothes = [
    {
        img: "https://media.bergdorfgoodman.com/f_auto,q_auto:low,ar_5:7,c_fill,dpr_2.0,w_720/01/bg_4035878_100273_m",
        category: "Bag",
        color: "Brown",
        brand: "prada",
        season: "Summer",
        _id: 1
    },
    {
        img: "https://images.unsplash.com/photo-1583743814966-8936f5b7be1a?q=80&w=1287&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D",
        category: "Top",
        color: "Black",
        brand: "No-brand",
        season: "Summer",
        _id: 2
    },
]
const closets = [
    {_id: 1, img: "", desc: "Default Closet", clothes: clothes},
    {_id: 2, img: "", desc: "Default Closet", clothes: clothes},
    {_id: 3, img: "", desc: "Default Closet", clothes: clothes},
];

const Home = () => {
    return(
        <Fragment>
            <div className={styles.container}>
                <h1>Your Closets</h1>
                <div className={styles.closets_container}>
                    <Closets closets={closets} />
                </div>
            </div>
        </Fragment>
    );
};

export default Home;
